import React from 'react';
import HeartRateChart from './components/HeartRateChart';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Gilet Intelligent pour Bébé</h1>
      </header>
      <HeartRateChart />
    </div>
  );
}

export default App;
